import React from 'react'

function Contact(props){

    var moment = require('moment');
    const time = props.contact.last_contact;

    return(
        <div className="card">
            <div className="card-image">
                <figure className="image is-4by3">
                <img src="https://bulma.io/images/placeholders/1280x960.png" alt="" />
                </figure>
            </div>
            <div className="card-content">
                <div className="media">
                <div className="media-content">
                    <Text style={{textTransform: 'capitalize'}}>{props.contact.name}</Text>
                    <p className="title is-4">{props.contact.name}</p>
                    <p className="subtitle is-6">@{props.contact.company}</p>
                </div>
                </div>
                <div className="content">
                    <div>Emails:
                        <div>
                            {props.contact.emails.map(c => {
                                return(
                                <div>{c}</div>
                                )
                            })}
                        </div>
                    </div>
                    <div>Phones:
                        <div>
                            {props.contact.phones.map(c => {
                                return(
                                <div>{c}</div>
                                )
                            })}
                        </div>
                    </div>
                    <div>{moment(time).fromNow()}</div>
                </div>
            </div>
        </div>
    );
}

export default Contact;
